import React, { Component } from "react";
import { Route, Link, Switch, Redirect } from "react-router-dom";

export default class BreedList extends Component {
    constructor(props) {
        super(props)
    }

    render() {
        console.log(this.props.birds);
        const allBirds = this.props.birds.map((bird, index) => {
            return <Link to={`/show/${bird.name}`}><img src={bird.image}
                key={index} /></Link>
        })
        console.log(this.props)
        return (
            <div>
                <h4>Birds</h4>

                <div className='allBirds'>
                    {allBirds}
                </div>
            </div>
        );
    }
}
